INSERT INTO `v1_9c7b84f7b9ab2cde76972cb48c8c9f99acf1e4d671821443cdf0f34db021f645` VALUES (5, 3, 10013, 3.1, -470.0, 0.0, 1, 2002, 4, "2024/03/15 15:00:00", "2024/06/22 14:59:59", "カノン", 130301, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ");
INSERT INTO `v1_9c7b84f7b9ab2cde76972cb48c8c9f99acf1e4d671821443cdf0f34db021f645` VALUES (2, 3, 10014, 6.15, -470.0, 0.0, 2, 2002, 4, "2024/03/15 15:00:00", "2024/06/22 14:59:59", "カノン", 130301, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？");
INSERT INTO `v1_9c7b84f7b9ab2cde76972cb48c8c9f99acf1e4d671821443cdf0f34db021f645` VALUES (2, 2, 10015, 0.0, -470.0, 0.0, 1, 2002, 4, "2024/03/15 15:00:00", "2024/06/22 14:59:59", "ナーナ", 130401, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー");
