INSERT INTO `v1_9c7b84f7b9ab2cde76972cb48c8c9f99acf1e4d671821443cdf0f34db021f645` VALUES (1, 1, 10017, 0.0, -470.0, 0.0, 1, 2002, 5, "2024/06/15 15:00:00", "2024/09/22 14:59:59", "ホウオウ", 130502, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう");
