INSERT INTO `v1_9c7b84f7b9ab2cde76972cb48c8c9f99acf1e4d671821443cdf0f34db021f645` VALUES (2, 1, 10020, 4.9, -470.0, 0.0, 1, 2002, 5, "2024/06/15 15:00:00", "2024/09/22 14:59:59", "ネア", 123301, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で");
INSERT INTO `v1_9c7b84f7b9ab2cde76972cb48c8c9f99acf1e4d671821443cdf0f34db021f645` VALUES (2, 1, 10021, 4.8, -470.0, 0.0, 2, 2002, 5, "2024/06/15 15:00:00", "2024/09/22 14:59:59", "ネア", 123301, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡");
